import React from "react";

function Button(props) {
  return (
    <>
      <div className=" button container">
        <a className="tasks font-sans" href={props.url}>
          <span className="font-weight-light">{props.text}</span>
        </a>
      </div>
    </>
  );
}

export default Button;
